function App() {
  return (
    <BrowserRouter>
      <div className="app">
        <Navbar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/analytics" element={<Analytics />} />
            <Route path="/saved" element={<SavedArticles />} />
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
